webpackJsonp([0xcae25e3e03e4],{769:function(A,e){A.exports={data:{markdownRemark:{headings:[],html:"<p>This well organized, popular festival of beer is one that cannot be missed. Hosted by experts of the brewing craft from around the world, Toronto’s Festival of Beer features 333 different brands of beer on site with 100 brewers. This is Canada’s premier celebration of the golden beverage, being one of the longest running and most popular festival in Toronto for adults. With the general admission of 39.50, this festival has cheap beer, a complimentary small mug, and entertainment for you to enjoy. This event is presented by the Beer Store every year and 2017 is this events 150th anniversary.  The important words I chose for this event are refreshing, fulfilling, sociable, intoxicating, stimulating, hearty, unique. These words are the vibe I wanted to give off with this rebranding. I designed a poster, a website, and a pamphlet for this event.</p>\n<p>![](../assets/screen shot 2018-03-30 at 2.48.24 pm.jpg)</p>\n<p>![](../assets/screen shot 2018-03-30 at 2.59.02 pm.jpg)</p>\n<p>![](../assets/screen shot 2018-03-30 at 2.58.40 pm.jpg)</p>\n<p>![](../assets/screen shot 2018-03-30 at 2.59.26 pm.jpg)</p>\n<p>![](../assets/screen shot 2018-03-30 at 2.59.42 pm.jpg)</p>",frontmatter:{title:"Toronto's Festival of Beer",graduate:"Stephanie Walser",category:"Communication Design",category2:"Brand Identity",category3:"Typography",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/the-next-website/static/screen shot 2018-03-30 at 2.49.19 pm-13a77df15eb98ddcea4697306b23aec6-a7a62.jpg",srcSet:"/the-next-website/static/screen shot 2018-03-30 at 2.49.19 pm-13a77df15eb98ddcea4697306b23aec6-5a1a9.jpg 375w,\n/the-next-website/static/screen shot 2018-03-30 at 2.49.19 pm-13a77df15eb98ddcea4697306b23aec6-0908c.jpg 750w,\n/the-next-website/static/screen shot 2018-03-30 at 2.49.19 pm-13a77df15eb98ddcea4697306b23aec6-a7a62.jpg 1500w,\n/the-next-website/static/screen shot 2018-03-30 at 2.49.19 pm-13a77df15eb98ddcea4697306b23aec6-83d7d.jpg 2000w",sizes:"(max-width: 1500px) 100vw, 1500px"}}}}}},pathContext:{slug:"/work/toronto-s-festival-of-beer/",name:"Toronto's Festival of Beer"}}}});
